import React from "react";
import Markdown from "markdown-to-jsx";
import { Box, BoxItem, Button, Card, CardContent, Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/styles';
import { ArrowBack } from '@material-ui/icons';
import profilbild from "./images/profilbild_test_2.png"

const Hem = () => {

    const useStyles = makeStyles({
        container: {
            padding: "0",
            margin: "0"
        },
        buttonCard : {
          marginLeft: "10px",
          marginTop: "10px",
          size: "small",
          borderRadius: "20px",
          backgroundColor: "rgb(51,51,51, 0.2)"
          
        },
        sectionCard : {
          marginBottom: "0",
          minHeight: "50vh"
          
        },
        sectionMain : {
          marginBottom: "0",
          minHeight: "50vh"
          },
          mainDiv: {
            margin: "20px"
          },
          imgProfile: {
            height: "200px"
          },
          imgProfile: {
            height: "250px",
            marginRight: "30px"
          },
          boxThing: {
            textAlign: "left",
            margin: "30px",
            display: "flex",
            position: "row"
          }
      })

      const classes = useStyles();
    return (
    <div className={classes.mainDiv}>
  
                        <Typography variant="h4">
                          Välkommen!
                        </Typography>
                        <Box className ={classes.boxThing}>
                        <Box className ={classes.imgProfile}
                        component="img"
                        alt="Picture did not load"
                        src={profilbild}
                        />
                        <Box>
                        <Typography variant="h6">
                          Jag studerar sista året på systemvetenskapsprogammet på Uppsala universitet. Denna sida är ett projekt för att lära mig mer om programmering och datakommunikation. Så småningom siktar jag på att ladda upp en del musik samt skrivna inlägg! 
                        </Typography>
                        </Box>
                        </Box>
                        
    </div>
    )
    
}

export {Hem}
